1:48 PM Prosecuting attorney Jack A. Pitzo in court for the State of Wisconsin.  Defendant Shaun M Kirchner in court.  Attorney Mark Emil Kershek in court for Shaun M Kirchner. 
Case called for plea and sentencing.
Court conducts plea colloquy.  Defendant enters a guilty plea to Counts 1 and 2.  Court finds defendant guilty.  Count 3 is dismissed and read in.
Recommendations by the State.  Recommendations by the Defense.  Statement by defendant.

The Court Orders the Following:

Count 1:
Imposed and Stayed Sentence of:
2 Years Imprisonment (Credit - 47 days if revoked) CONCURRENT with Count 2
-	18 Months of Initial Confinement
-	6 Months of Extended Supervision

Defendant is not eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Term of Probation: 2 Years
Conditions of Probation/Extended Supervision:
-	Absolute Sobriety; 
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	All prescriptions to be filled at the same pharmacy
-	Inform agent of all prescriptions;
-	Engage in current Mental Health treatment;
-	Maintain current programs and develop new ones as needed for Mental Health;
-	Complete 20 hours community service for each year of probation;
-	Defendant is not to possess any dangerous weapons;
-	Maintain a valid Driver's License;
-	Operate a Motor Vehicle only with a Valid Driver's License;
-	Comply with all orders of courts with competent jurisdiction;
-	No new law violations;

Condition Time: 60 Days Huber with RELEASE FOR WORK, WORK SEARCH AND TREATMENT - STAYED to be used at the Agent's discretion

COSTS:  $ 243.00

DNA Surcharge: $ 200.00

DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

Total costs/fine/forfeiture:  to be paid as a condition of probation within the first 18 months of probation. Failure to pay;  will result in a civil judgment.


